    const Cardarray = robo.map((user,i)=> {
  return <Card id={robo[i].id} name={robo[i].name} email={robo[i].email} /> ;
    })
    return (
        <>
        {Cardarray} 
        </>
        // Has to destructure coz its a function.
    );
}

